    ]
  },
  {
    id: 5,
    name: "Kara Devin",
    image: "https://example.com/jane-smith.jpg",
    about: "Kara has been with the Grphyons for 2 years. She loves animals and is a volunteer as the RSPCA.",
    positions: ["WA", "GA"],
